import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';
import {
  BottomNavigation,
  BottomNavigationTab,
  Icon,
} from '@ui-kitten/components';

import TestHome from '../../screens/TestScreens/testhome';
import TestSettings from '../../screens/TestScreens/testsettings';

const { Navigator, Screen } = createBottomTabNavigator();

const StarIcon = (props) => <Icon {...props} name="star" />;
const BottomTabBar = ({ navigation, state }) => (
  <BottomNavigation
    selectedIndex={state.index}
    onSelect={(index) => navigation.navigate(state.routeNames[index])}
  >
    <BottomNavigationTab icon={StarIcon} title="HOME" />
    <BottomNavigationTab title="SETTINGS" />
  </BottomNavigation>
);

const TabNavigator = () => {
  return (
    <NavigationContainer>
      <Navigator tabBar={(props) => <BottomTabBar {...props} />}>
        {/* <Screen name="HOME" component={TestHome} /> */}
        <Screen name="SETTINGS" component={TestSettings} />
      </Navigator>
    </NavigationContainer>
  );
};

export default TabNavigator;
